import React from "react";

const WineSelectRow = (props) => {
  return (
    <div
      className={props.bottle}
      onClick={handleWineSelect}
      data-id="boldred"
    >
      <h3>Bold Red</h3>
      <p className="subtype-list">{wineTypes.boldred.subtypes.join(", ")}</p>
    </div>
  );
};

export default WineSelectRow;

